import React from 'react';

import { 
  Container,
  Imagem,
  DivInput,
  LogoImg,
  Title,
  TextInput,
  InputEmail


 } from './styles';

 import logo from '../../assets/Image/Logo.png';
 import img1 from '../../assets/Image/image.png';

export default function signIn() {
  return (
    <Container>
      <DivInput>
        <LogoImg src={logo} />

        <Title>Sign Up</Title>

        <TextInput>Email: </TextInput>
        <InputEmail />

        <TextInput>Senha: </TextInput>
        <InputEmail />
      </DivInput>
      <Imagem src={img1} />
    </Container>
  );
}
